	@Override
	public List<Map<String, String>> analysisJson(List<String> data,
			String phoneNumber, String... agrs) {
		 logger.warn("-------------联通："+phoneNumber+"数据解析-------------");
		 List<Map<String, String>> list=new ArrayList<>();
		 for (int i = 0; i < data.size(); i++) {
			 logger.warn("-------------联通："+phoneNumber+" 第"+i+"次获取到的数据："+data.get(i)+"-------------");
			 JSONObject json1=JSONObject.fromObject(data.get(i));
			 JSONObject json2=(JSONObject) json1.get("pageMap");
			 List<Map<String, String>> resultList=(List<Map<String, String>>) json2.get("result");
			 for (int j = 0; j < resultList.size(); j++) {
				 Map<String, String> map = new HashMap<>();
				 Map<String, String> json=resultList.get(j);
	             map.put("CallNumber", json.get("othernum").toString());// 被叫号码
	             map.put("CallType", json.get("landtype").toString());// "通话类型",
	             map.put("CallAddress", json.get("calledhome").toString());// 归属地
	             map.put("CallWay", json.get("calltypeName").toString());	// "类型"
	             map.put("CallMoney", json.get("totalfee").toString());// "费用(分)",
	             map.put("CallTime", json.get("calldate").toString().substring(5) + " " + json.get("calltime").toString());// 通话开始时间
	             map.put("CallDuration", json.get("calllonghour").toString());// 时长(秒)
	             list.add(map);
			}
			 
		 }
		 logger.warn("-------------联通："+phoneNumber+"数据解析完成-------------");
		return list;
	}

